    this.queue = [];
    this.pc = new RTCPeerConnection(iceConfig);
    var handler = (event, state) => {
      this.log(event.type, state);
      switch (state) {
        case "closed":
        case "failed":
        case "disconnected":
          this.end();
          break;
      }
    };
