$(document).keydown(function (e) {
  processKeyDown(e);
});

function processKeyDown(e) {
  if (!$("#session").is(":visible") || $("#showWebPage").is(":visible")) {
    return;
  }
  if ((e.target.tagName.toLowerCase() === 'input' && (e.target.type != "submit" && e.target.type != "button"))
    || e.target.tagName.toLowerCase() === 'textarea') {
    // ignore text boxes
    return;
  }

  ctrlKeyDown = !!(e.ctrlKey);
  shiftKeyDown = !!(e.shiftKey);
  updateCtrlMenu(e);

  if (e.shiftKey) {
    powerDriveOn = true;
  } else {
    powerDriveOn = false;
  }

  switch (e.keyCode) {
    case 37: // left, arrow
    case 65: // left, a

      // If key down is less than 200ms, do turn by degree
      // So we are firing a timer here after 200ms to update leftState for firing driver commands
      if (leftKeyDownStartTime == 0) {
        leftKeyDownStartTime = Date.now();
        leftTurnTimeout = window.setTimeout(function () {
          leftState = 1;
          fireDriveCommands();
        }, 200);
      }

      return false;

    case 39: // right, arrow
    case 68: // right, d

      // If key down is less than 200ms, do turn by degree
      // So we are firing a timer here after 200ms to update leftState for firing driver commands
      if (rightKeyDownStartTime == 0) {
        rightKeyDownStartTime = Date.now();
        rightTurnTimeout = window.setTimeout(function () {
          rightState = 1;
          fireDriveCommands();
        }, 200);
      }

      return false;

    case 38: // forward, arrow
    case 87: // forward, w
      if (forwardState == 0 && kickstandState == kDRKickstand_stateDeployed) {
        parkAction();
      }
      forwardState = 1;
      return false;

    case 40: // backward, arrow
    case 83: // backward, s
      backwardState = 1;
      return false;

    case 82: // pole up, r
      poleUpState = 1;
      return true;

    case 70: // pole down, f
      poleDownState = 1;
      return false;

    case 32: // flip, space bar
      if (flipKeyDidRelease) {
        flipAction();
        flipKeyDidRelease = false;
      }
      return false;

    case 90: // zoom in for D3, z
      if (drawDepth) {
        drawDepth.zoomIn();
      }
      return false;
    case 88: // zoom out for D3, x
      if (drawDepth) {
        drawDepth.zoomOut();
      }
      return false;

    case 67: // allow mouse target circle
      cKeyDown = true;
      return false;
  }
  return; //using "return" other attached events will execute
};

$(document).keyup(function (e) {
  processKeyUp(e);
});

function processKeyUp(e) {
  if ($("#showWebPage").is(":visible")) {
    return;
  }
  if (!$("#session").is(":visible")) {
    if (e.keyCode != 27) { // allow esc
      return;
    }
  }
  if ((e.target.tagName.toLowerCase() === 'input' && (e.target.type != "submit" && e.target.type != "button"))
    || e.target.tagName.toLowerCase() === 'textarea') {
    // ignore text boxes
    return;
  }

  ctrlKeyDown = !!(e.ctrlKey);
  shiftKeyDown = !!(e.shiftKey);
  updateCtrlMenu(e);

  if (e.shiftKey) {
    powerDriveOn = true;
  } else {
    powerDriveOn = false;
  }

  switch (e.keyCode) {
    case 35: // end call, end
      disconnect();
      return false;

    case 37: // left, arrow
    case 65: // left, a
      window.clearTimeout(leftTurnTimeout);
      var diff = Date.now() - leftKeyDownStartTime;
      //console.log("keyup " + diff + "ms");
      if (diff < 100) {
        //console.log("turn by 5 degrees");
        var degree = 5.0;
        sendCommandWithData(kDRCommandTurnBy, { "degrees": degree, "degreesWhileDriving": degree / 2.0 });
      } else if (diff < 200) {
        //console.log("Turn 8 degrees");
        var degree = 8.0;
        sendCommandWithData(kDRCommandTurnBy, { "degrees": degree, "degreesWhileDriving": degree / 2.0 });
      }
      leftKeyDownStartTime = 0;
      leftState = 0;
      return false;

    // case 67: // capture photo, c
    // 	takePhoto();
    // 	break;

    case 39: // right, arrow
    case 68: // right, d

      window.clearTimeout(rightTurnTimeout);
      var diff = Date.now() - rightKeyDownStartTime;
      //console.log("keyup " + diff + "ms");
      if (diff < 100) {
        //console.log("turn by -5 degrees");
        var degree = -5.0;
        sendCommandWithData(kDRCommandTurnBy, { "degrees": degree, "degreesWhileDriving": degree / 2.0 });
      } else if (diff < 200) {
        //console.log("Turn -8 degrees");
        var degree = -8.0;
        sendCommandWithData(kDRCommandTurnBy, { "degrees": degree, "degreesWhileDriving": degree / 2.0 });
      }
      rightKeyDownStartTime = 0;
      rightState = 0;
      return false;

    case 38: // forward, arrow
    case 87: // forward, w
      forwardState = 0;
      return false;

    case 40: // backward, arrow
    case 83: // backward, s
      backwardState = 0;
      return false;

    case 82: // pole up, r
      poleUpState = 0;
      return false;

    case 70: // pole down, f
      poleDownState = 0;
      return false;

    case 32: // flip, space bar
      flipKeyDidRelease = true;
      return false;

    case 79: // O
      togglePictureInPicture();
      return false;

    case 80: // park, p
      parkAction();
      return false;

    case 27: // end call, esc
      // disconnect();
      if (drawDepth) {
        drawDepth.cancelPendingClickToDrive();
      }
      cancelTarget();
      hideLastShownMessageId();
      return false;

    case 77: // mute, m
      muteAction();
      return false;

    case 78: // speaker mute, n
      speakerMuteAction();
      return false;

    case 219: // speaker volume down, []
      speakerVolumeDown();
      return false;

    case 221: // speaker volume up, ]
      speakerVolumeUp();
      return false;

    case 187:
      if (e.shiftKey) {
        // volume up, + key
        volumeUp();
      }
      return false;

    case 189:
      if (e.shiftKey) {
        // volume down, - key
        volumeDown();
      }
      return false;

    case 107:
      // volume up, num pad + key
      volumeUp();
      return false;

    case 109:
      // volume down, num pad - key
      volumeDown();
      return false;

    case 73: // info/quality stats, i
      toggleQualityStats();
      saveSettings();
      return false;

    case 66:
      if (remoteRobotSupports("audioBoost")) {
        if (audioBoostLevel == 0.0) {
          audioBoostLevel = 0.5;
        } else {
          audioBoostLevel = 0.0;
        }
        sendCommandWithData(kDRCommandAudioBoostLevel, { "level": audioBoostLevel });
      }
      return false;

    case 67: // allow mouse target circle
      cKeyDown = false;
      return false;

  }
  return; // using "return" other attached events will execute
};

window.addEventListener('blur', function () {
  clearKeyboardCommands();
});

function clearKeyboardCommands() {
  leftState = 0;
  forwardState = 0;
  rightState = 0;
  backwardState = 0;
  poleUpState = 0;
  poleDownState = 0;
  tiltSpeed = 0;
  flipKeyDidRelease = true;
  throttleSpeed = 0;
  turnSpeed = 0;

  ctrlKeyDown = false;
  shiftKeyDown = false;
  updateCtrlMenu();
}

