function addBlink(o) {
  if (blinkArray.indexOf(o) < 0) {
    blinkArray.push(o);
  }
}

function removeBlink(o) {
  var counter = 0;
  for (var i = 0; i < blinkArray.length; i++) {
    if (blinkArray[i] == o) {
      blinkArray.splice(i, 1);
      i--;
      counter++;
    }
  }
  if (counter > 0) {
    updateUserInterface();
  }
}

function fireBlink() {
  for (var i = 0; i < blinkArray.length; i++) {
    $(blinkArray[i]).toggleClass("on");
  }
}

